蘇澳鎮岳明新村為宜蘭大陳新村中規模最大者，「岳明」之稱謂，乃取人稱「大陳之母」、曾任江浙總部政治部主任兼大陳地區行政督察專員的沈之岳之名。「明」字則來自沈之岳化名黃「明」，遂名「岳明新村」。 　　岳明新村位於蘇澳鎮岳明里，居民主要來自下大陳，新村落成時有320戶1335人，是僅次於花蓮大陳一村的大型大陳新村，以近海漁業為主要生業。政府配給予岳明新村全村6馬力引擎、1.9噸級舢舨漁船共56艘。 　　岳明新村房舍共有49排，相較於其他三處新村，兩排間之街道寬度較寬，較顯開闊。全村共有6處公廁。此外，由於岳明新村人口眾多，因此政府特別設置岳明國小，是宜蘭縣唯一為大陳人所設立的學校，於1956年創設。

